import React from 'react'
import RaceTableRow from './RaceTableRow'

const RaceTable = ({ list }) => {
  return (
      <div class="race-table">
        <ul>
          {list.map((race, idx) => {
            return <RaceTableRow key={`${idx}-race-${race.name}`} race={race}/>
          })}
        </ul>
      </div>
  )
}

export default RaceTable
